-- Description: Create Community Hospital Database (CHDB) objects
-- Usage: When running script, you will be prompted for a connection, use sys
/****************************************************************************/

CLEAR SCREEN;
SET SERVEROUTPUT ON;
SET VERIFY OFF;
SET PAGESIZE 500;

-- If chdb user exists, drop it
ALTER SESSION SET "_ORACLE_SCRIPT" = TRUE;
DECLARE
  v_count NUMBER;
BEGIN
  SELECT COUNT(*)
    INTO v_count
    FROM dba_users
    WHERE username = 'CHDB';
  IF v_count > 0 THEN
    DBMS_OUTPUT.PUT_LINE('Dropping user chdb');
    EXECUTE IMMEDIATE 'DROP USER chdb CASCADE';
  END IF;
END;
/

-- Suppress completion messages
SET FEEDBACK OFF

-- Prevent passwords from expiring. Not recommended for production
ALTER PROFILE default LIMIT PASSWORD_LIFE_TIME UNLIMITED;

PROMPT Create chdb user
CREATE USER chdb IDENTIFIED BY oracle;

PROMPT Grant DBA, CONNECT and RESOURCE roles
GRANT "DBA" TO chdb;
GRANT "CONNECT" TO chdb;
GRANT "RESOURCE" TO chdb;

PROMPT Connect as chdb
CONNECT chdb/oracle;

-- Turn off substition variables (default is ampersand &)
SET DEFINE OFF

-- Set date format
ALTER SESSION SET NLS_DATE_FORMAT = 'MM/DD/YYYY';

PROMPT Create departments table
CREATE TABLE departments (
	department_id INT PRIMARY KEY,
	department_name VARCHAR2(30) NOT NULL,
	manager_first_name VARCHAR2(30),
	manager_last_name VARCHAR2(30));

PROMPT Create medications table
CREATE TABLE medications (
	medication_id INT PRIMARY KEY,
	medication_description VARCHAR2(25) NOT NULL,
	medication_cost DECIMAL(9, 2) CHECK (medication_cost > 0),
	package_size VARCHAR2(20),
	strength VARCHAR2(20),
	sig VARCHAR2(20),
	units_used_ytd INT,
	last_prescribed_date DATE);

PROMPT Create nursing units table
CREATE TABLE nursing_units (
	nursing_unit_id VARCHAR2(10) PRIMARY KEY,
	specialty VARCHAR2(20) NOT NULL,
	manager_first_name VARCHAR2(30),
	manager_last_name VARCHAR2(30),
	beds INT CHECK (Beds > 0),
	extension INT);

PROMPT Create physicians table
CREATE TABLE physicians (
	physician_id INT PRIMARY KEY,
	first_name VARCHAR2(30) NULL,
	last_name VARCHAR2(30) NULL,
	specialty VARCHAR2(25) NULL,
	phone VARCHAR2(15) NULL,
	ohip_registration INT NULL);

PROMPT Create provinces table
CREATE TABLE provinces (
	province_id CHAR(2) PRIMARY KEY,
	province_name VARCHAR2(30) NOT NULL);

PROMPT Create patients table
CREATE TABLE patients (
	patient_id INT PRIMARY KEY,
	first_name VARCHAR2(30) NOT NULL,
	last_name VARCHAR2(30) NOT NULL,
	gender CHAR(1) NOT NULL,
	birth_date DATE,
	street_address VARCHAR2(30),
	city VARCHAR2(30),
	province_id CHAR(2) REFERENCES provinces (province_id),
	postal_code VARCHAR2(7),
	health_card VARCHAR2(10) NOT NULL,
	allergies VARCHAR2(80),
	patient_height DECIMAL(3, 0) CHECK (patient_height > 0),
	patient_weight DECIMAL(4, 0) CHECK (patient_weight > 0));

PROMPT Create vendors table
CREATE TABLE vendors (
	vendor_id INT PRIMARY KEY,
	vendor_name VARCHAR2(30) NOT NULL,
	street_address VARCHAR2(30),
	city VARCHAR2(30),
	province_id CHAR(2) REFERENCES provinces (province_id),
	postal_code VARCHAR2(7),
	contact_first_name VARCHAR2(30),
	contact_last_name VARCHAR2(30),
	purchases_ytd DECIMAL(9, 2));

PROMPT Create admissions table
CREATE TABLE admissions (
	patient_id INT REFERENCES patients (patient_id),
	admission_date DATE,
	discharge_date DATE,
	primary_diagnosis VARCHAR2(50),
	secondary_diagnoses VARCHAR2(240),
	attending_physician_id INT REFERENCES physicians (physician_id),
	nursing_unit_id VARCHAR2(10) REFERENCES nursing_units (nursing_unit_id),
	room INT,
	bed INT,
	CONSTRAINT pk_admissions PRIMARY KEY (patient_id, admission_date));

PROMPT Create encounters table
CREATE TABLE encounters (
	patient_id INT REFERENCES patients (patient_id),
	physician_id INT REFERENCES physicians (physician_id),
	encounter_date_time TIMESTAMP,
	Notes VARCHAR2(250),
	CONSTRAINT pk_encounters PRIMARY KEY (patient_id, physician_id, encounter_date_time));

PROMPT Create items table
CREATE TABLE items (
	item_id INT PRIMARY KEY,
	item_description VARCHAR2(30) NOT NULL,
	item_cost DECIMAL(9, 2),
	quantity_on_hand INT,
	usage_ytd INT,
	primary_vendor_id INT REFERENCES vendors (vendor_id),
	order_quantity INT,
	order_point INT);

PROMPT Create purchase orders table
CREATE TABLE purchase_orders (
	purchase_order_id INT PRIMARY KEY,
	order_date DATE NOT NULL,
	department_id INT REFERENCES departments (department_id),
	vendor_id INT REFERENCES vendors (vendor_id),
	total_amount DECIMAL(9, 2) NULL,
	order_status VARCHAR2(10) NULL);

PROMPT Create unit dose orders table
CREATE TABLE unit_dose_orders (
	unit_dose_order_id INT PRIMARY KEY,
	patient_id INT NOT NULL REFERENCES patients (patient_id),
	medication_id INT NOT NULL REFERENCES medications (medication_id),
	dosage VARCHAR2(20),
	sig VARCHAR2(20),
	dosage_route VARCHAR2(10),
	pharmacist_initials CHAR(3) NOT NULL,
	entered_date DATE);

PROMPT Create purchase prder lines table
CREATE TABLE purchase_order_lines (
	purchase_order_id INT REFERENCES purchase_orders (purchase_order_id),
    line_num INT,
	item_id INT REFERENCES items (item_id),
	units_ordered INT,
	cost_per_item DECIMAL(9, 2),
	units_received INT,
	units_cancelled INT,
	date_last_arrived DATE);

