COMMIT;

-- Verify inserts
CREATE TABLE verify (
  table_name varchar(30), 
  actual INT, 
  expected INT);


PROMPT
PROMPT Verification
SELECT table_name, actual, expected, expected - actual discrepancy FROM verify;
DROP TABLE verify;